import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './students.css'
import menu from '../../assets/icons8-menu.svg';
import user from '../../assets/icons8-user-24.png';
import home from '../../assets/icons8-home-24.png';
import arrow from '../../assets/icons8-arrow-24.png';
import cube from '../../assets/icons8-cube-24.png';

function Students() {
  const [students, setStudents] = useState([]);

  useEffect(() => {
    axios.get('https://localhost:7190/api/student')
        .then(response => {
            setStudents(response.data);
        })
        .catch(error => {
            console.error('Error fetching data:', error);
        });
}, []);

  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [contactPerson, setContactPerson] = useState('');
  const [contactNo, setContactNo] = useState('');
  const [email, setEmail] = useState('');
  const [dob, setDOB] = useState('');
  const [age, setAge] = useState('');

  const handleSubmit = () => {
    // Create an object with the values
    const data = {
      firstName,
      lastName,
      contactPerson,
      contactNo,
      email,
      dob,
      age,
    };

   
    axios.post('https://localhost:7190/api/student', data)
      .then(response => {
        // Handle success, e.g., show a success message
       alert('Data sent successfully!', data);
      })
      .catch(error => {
        // Handle error, e.g., show an error message
        alert('Error sending data:', error);
      });
  
  };

  return (
    <div>
        <div className='tophead'>
            <img src={menu} alt='menu'/>
            <img src={user} alt='user'/>
        </div>

        <div className='sechead'>

        <img src={home} alt='home'/>
        <img src={arrow} alt='arrow'/>
        <h1 className='h1'>Students</h1>

        </div>

        <div className='thead'>

        <div className='thirdhead'>

        <img src={cube} alt='cube'/>
        <h1 className='h1'>Students Details</h1>
            

        </div>
        </div>
        <div className='thead'>

        <div className='details'>
            <div className='details1'>

           
            <div className='textbox'>
                <h2 className='h2'>First Name</h2>
                <input
              type="text"
              className='input'
              name='firstName'
              onChange={(e) => setFirstName(e.target.value)} 
            />

            </div>

            <div className='textbox'>
                <h2 className='h2'>Last Name</h2>
                <input
              type="text"
              className='input'
              onChange={(e) => setLastName(e.target.value)} 
            />

            </div>

            <div className='textbox'>
                <h2 className='h2'>Contact Person </h2>
                <input
              type="text"
              className='input'
              onChange={(e) => setContactPerson(e.target.value)} 
            />

            </div>

              <div className='textbox'>
                <h2 className='h2'>Contact No</h2>
                <input
              type="text"
              className='input'
              onChange={(e) => setContactNo(e.target.value)} 
            />

            </div>

            <div className='textbox'>
                <h2 className='h2'>Email Address</h2>
                <input
              type="email"
              className='input'
              onChange={(e) => setEmail(e.target.value)} 
            />

            </div>

            <div className='textbox'>
                <h2 className='h2'>DOB</h2>
                <input
              type="date"
              className='input'
              onChange={(e) => setDOB(e.target.value)} 
            />

            </div>
            
            <div className='textbox'>
                <h2 className='h2'>Age</h2>
                <input
              type="number"
              className='input'
              onChange={(e) => setAge(e.target.value)} 
            />

            </div>
            </div>

            <div className='button-row'>
            <button className='button' type="submit" onClick={handleSubmit}>Submit</button>
               <button className='button'>Save</button>
               <button className='button'>Reset</button>
            </div>
        </div>
        </div>

        <div className='thead'>
        <div className='thirdhead'>
             <img src={cube} alt='cube'/>
             <h1 className='h1'>Exisiting Students</h1>
        </div>
        </div>
        <div className='thead'>
        <div className="table-container">
      <table className="eight-column-table">
        <thead>
          <tr>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Contact Person</th>
            <th>Contact No</th>
            <th>Email Address</th>
            <th>Date of birth</th>
            <th>Age</th>
            <th>Classroom</th>
            <th>Column 9</th>
          </tr>
        </thead>
        <tbody>
        {students.map(student => (
          <tr key={student.studentID}>
            <td> {student.firstName}</td>
            <td>{student.lastName}</td>
            <td>{student.contactPerson}</td>
            <td>{student.contactNo}</td>
            <td>{student.emailAddress}</td>
            <td>{student.dateOfBirth}</td>
            <td>{student.age}</td>
            <td>{student.classroom}</td>
            <td> <div >
               <button className='button1'>Add</button>
               <button className='button1'>Save</button>
            </div></td>
          </tr>
             ))}
        </tbody>
      </table>
    </div>
        </div>

    </div>
  )
}

export default Students
